import React, { useState } from "react";
import "./App.css";

const Square = (props) => (
   <button className='square' onClick={props.onClick}>
      {props.value}
   </button>
);

const Board = (props) => {
   const renderSquare = (i) => <Square value={props.squares[i]} onClick={() => props.onClick(i)} />;
   return (
      <div>
         <div className='board-row'>
            {renderSquare(0)}
            {renderSquare(1)}
            {renderSquare(2)}
         </div>
         <div className='board-row'>
            {renderSquare(3)}
            {renderSquare(4)}
            {renderSquare(5)}
         </div>
         <div className='board-row'>
            {renderSquare(6)}
            {renderSquare(7)}
            {renderSquare(8)}
         </div>
      </div>
   );
};
